import {useParams} from "react-router-dom";
import {useEffect, useState} from "react";

function MovieDetail({data}) {
  const {id} = useParams();
  console.log(id);
  console.log("Data Movie Detail:", data);
  const [detail, setDetail] = useState({});

  useEffect(() => {
    fetch(
      `https://api.themoviedb.org/3/movie/${id}?api_key=131f3dc4657440aa2ed80c0a22a7d1f9&language=en-US`
    )
      .then((res) => res.json())
      .then((res) => {
        setDetail(res);
      })
      .catch((err) => {});
  }, []);
  const resultRegres = detail.map((res) => res);
  console.log(resultRegres);
  return (
    <div className="bg-gradient-to-t from-white to-gray-800">
      <div className="container mx-auto">
        <div className="grid grid-cols-2 gap-2 ">
          <div>
            <img
              className="rounded-[5.5rem] mt-[5rem]"
              src={
                "https://www.themoviedb.org/t/p/w600_and_h900_bestv2" +
                detail.poster_path
              }
              alt={detail.title}
            />
          </div>
          <div>
            <div className="grid-rows-1">
              <div>
                <h1 className="mt-10 text-6xl text-white font-extrabold">
                  {detail.title}
                </h1>
              </div>
              <div>
                <p className="text-white mt-2">
                  {detail.release_date} - {detail.status}
                </p>
              </div>
              <div>Rate Start</div>
              <div>OverView</div>
              <div>Heloooooooooooooooooooooooooooooooooooooooooooooooo</div>
              <div>Heloooooooooooooooooooooooooooooooooooooooooooooooo</div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default MovieDetail;
